import React from 'react';

const ImageLinkForm = () => {
    return(
        <div>
            <div>
            <p>This Magic Brain will detect faces in your pictures. Give it a try :)</p>
            </div>
            <div>
                <input type='text'/>
                <button></button>
            </div>
        </div>
    )
}


export default ImageLinkForm;
